import styled from 'styled-components';
// import Bg from './img/Bg.jpg';

export const HomeDiv = styled.div`
    > h1 {
        padding-top: 41.875vh;
        font-size: 32px;
        margin: 0;
    }

    > button {
        padding: 10px 30px;
        margin-top: 80px;
    }
`

// export default HomeDiv

export const TestDiv = styled.image`
    > h3 {
        padding: 30px 0;
        background-color: white;
        color: black
    }

    > img {
    width: 100px;
    height: 100px;
    }
`
